<!doctype html><html class="dark" color-theme="system" lang="en" xml:lang="en"><head><meta charset="utf-8"/><title>Webpack One App</title><script defer="defer" src="main.js"></script></head><body><h1>Hello world!</h1><h2>Tip: Check your console</h2><p>This is the webpack One configuration test output.</p></body><script>if ("serviceWorker" in navigator) {
      window.addEventListener("load", () => {
        navigator.serviceWorker
          .register("service-worker.js")
          .then((registration) => {
            console.log("Service Worker registered: ", registration);
          })
          .catch((registrationError) => {
            console.error(
              "Service Worker registration failed: ",
              registrationError
            );
          });
      });
    }</script><script>index.js;</script></html>
